/* Lib */
import cx from 'classnames'
import { useEffect, useState } from 'react'

const Index = () => {
  const [cluster, setCluster] = useState([])

  const fetchCluster = async () => {
    await fetch('/api/blog')
      .then((res) => res.json())
      .then((result) => {
        setCluster(result)
      })
  }

  useEffect(() => {
    fetchCluster()
  }, [])

  return <>{cluster.length > 0 && <div>Hej</div>}</>
}

export default Index
